import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  useLocation,
} from "react-router-dom";
import { AnimatePresence, motion } from "framer-motion";

import Home from "./components/Home";
import About from "./components/About";
import Projects from "./components/Projects";
import Contact from "./components/Contact";
import Pro1 from "./components/projects/Pro1";
import Pro2 from "./components/projects/Pro2";
import Pro3 from "./components/projects/Pro3";
import Pro4 from "./components/projects/Pro4";
import Pro5 from "./components/projects/Pro5";
import Pro6 from "./components/projects/Pro6";
import Pro7 from "./components/projects/Pro7";
import Pro8 from "./components/projects/Pro8";

const App = () => {
  const location = useLocation();

  // Define the animation for route transitions
  const pageTransition = {
    initial: { opacity: 0, x: "-100vw" },
    animate: { opacity: 1, x: 0 },
    exit: { opacity: 0, x: "100vw" },
    transition: { duration: 0.5, ease: "easeInOut" },
  };

  return (
    <AnimatePresence mode="wait">
      <Routes location={location} key={location.pathname}>
        {/* Wrapping each route's component with motion.div for transitions */}
        <Route
          path="/"
          element={
            <motion.div {...pageTransition}>
              <Home />
            </motion.div>
          }
        />
        <Route
          path="/about"
          element={
            <motion.div {...pageTransition}>
              <About />
            </motion.div>
          }
        />
        <Route
          path="/projects"
          element={
            <motion.div {...pageTransition}>
              <Projects />
            </motion.div>
          }
        />
        <Route
          path="/contact"
          element={
            <motion.div {...pageTransition}>
              <Contact />
            </motion.div>
          }
        />
        <Route
          path="/pro1"
          element={
            <motion.div {...pageTransition}>
              <Pro1 />
            </motion.div>
          }
        />
        <Route
          path="/pro2"
          element={
            <motion.div {...pageTransition}>
              <Pro2 />
            </motion.div>
          }
        />
        <Route
          path="/pro3"
          element={
            <motion.div {...pageTransition}>
              <Pro3 />
            </motion.div>
          }
        />
        <Route
          path="/pro4"
          element={
            <motion.div {...pageTransition}>
              <Pro4 />
            </motion.div>
          }
        />
        <Route
          path="/pro5"
          element={
            <motion.div {...pageTransition}>
              <Pro5 />
            </motion.div>
          }
        />
        <Route
          path="/pro6"
          element={
            <motion.div {...pageTransition}>
              <Pro6 />
            </motion.div>
          }
        />
        <Route
          path="/pro7"
          element={
            <motion.div {...pageTransition}>
              <Pro7 />
            </motion.div>
          }
        />
        <Route
          path="/pro8"
          element={
            <motion.div {...pageTransition}>
              <Pro8 />
            </motion.div>
          }
        />
      </Routes>
    </AnimatePresence>
  );
};

const AppWrapper = () => (
  <Router>
    <App />
  </Router>
);

export default AppWrapper;
